I got a piper doll ans she feels nice when I cuddle with her. TPE feels firm and nice specially her tights. I have no experience with silicon, but from what I've seen silicon is more resistant 

&#x200B;

My doll is 62lb and boi she's heavy. if you get a taller doll she might be to heavy. So you have to also take that into consideration. Even if you leave her on your bed. It might damage the material in the long run.
